function updateWords(letter) { 
  if (letter == "enter") {
    displayLoading();
    setTimeout(() => {
      handleSubmitWord();
    }, 20);
    return
  } 
  var currentWord = getCurrentWordArr();
  if (letter == "del") {
    currentWord.pop();
    var nextSquare = document.querySelector(`#square_${guessedWords.length - 1}_${currentWord.length}`);
    nextSquare.textContent = "";
  }
  else if (currentWord && currentWord.length < 5) {
    var nextSquare = document.querySelector(`#square_${guessedWords.length - 1}_${currentWord.length}`);
    currentWord.push(letter);
    nextSquare.textContent = letter;
  }
}

function createColourMap(guess, word) {
  var guessArr = guess.split("");
  var wordArr = word.split("");
  return guessArr.map((letter, index) => {
    if (letter === wordArr[index]) return 2;

    let lettersInWord = 0;
    wordArr.forEach(char => char === letter ? lettersInWord += 1 : null);
  
    for (let i = 0; i < index; i++) {
      if (guessArr[i] === letter) lettersInWord -= 1;
    }
  
    for (let i = index + 1; i < 5; i++) {
      if (guessArr[i] === letter && wordArr[i] === letter) lettersInWord -= 1;
    }
  
    if (0 < lettersInWord) return 1;
  
    return 0;
  });
}

function getTileColour(letter, index, word) {
  if (letter == wordToBeGuessed.split("")[index]) return "green";

  let lettersInWord = 0;
  wordToBeGuessed.split("").forEach(char => char == letter ? lettersInWord += 1 : null);

  let lettersBeforeIndex = 0;
  for (let i = 0; i < index; i++) {
    if (word.split("")[i] == letter) lettersBeforeIndex += 1;
  }

  for (let i = index + 1; i < 5; i++) {
    if (word.split("")[i] == letter && wordToBeGuessed.split("")[i] == letter) lettersBeforeIndex += 1;
  }

  if (lettersBeforeIndex < lettersInWord) return "yellow";

  return "grey";
}

function findRemaingWord(guess, currentColourMap, reducedWordList) {
  var currentColourMapStr = currentColourMap.join("");
  return reducedWordList.filter(word => {
    return currentColourMapStr === createColourMap(guess, word).join("");
  });
}

function quickFindRemaingWord(guess, currentColourMap, reducedWordList) {
  var currentColourMapStr = currentColourMap.join("");
  return reducedWordList.filter(word => {
    return currentColourMapStr === createColourMap(guess, word).join("");
  });
}


