function keyPressed(e) {
  letter = e.target.getAttribute("data-key");

  updateWords(letter);
}

function keyDown(e) {
  let letter = e.key;
  if (letter == "Enter") letter = "enter";
  if (letter == "Backspace") letter = "del";
  if (letter.split("").length != 1 && letter != "enter" && letter != "del") return;
  updateWords(letter);
}

